            state.shouldUseTemplate2colsTmp = true;
            state.shouldUseTemplate121Tmp = false;
            state.shouldUseTemplate13Tmp = false;
            state.shouldUseTemplate22Tmp = true;
            state.shouldUseTemplate31Tmp = false;
